selector_to_html = {"a[href=\"#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vitesse de transmission du clavier du destinataire<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Faible vitesse<a class=\"headerlink\" href=\"#low-speed\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>Il n\u2019est valide que dans le mode 2.4G sans fil et quand la r\u00e9ceptrice re\u00e7oit normalement.</p>\n</aside>", "a[href=\"#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appairage unique<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523IFSNO241.png\"><img alt=\"../../media/2523IFSNO241.png\" src=\"../../media/2523IFSNO241.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Mode Sans fil</span><a class=\"headerlink\" href=\"#id5\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/25KB23SP.png\"><img alt=\"../../media/25KB23SP.png\" src=\"../../media/25KB23SP.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Obtenir la vitesse de transmission du clavier du r\u00e9cepteur<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id3\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a></span><a class=\"headerlink\" href=\"#id7\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY.png\"><img alt=\"../../media/24USB23KEY.png\" src=\"../../media/24USB23KEY.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Haute Vitesse</span><a class=\"headerlink\" href=\"#id8\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY4.png\"><img alt=\"../../media/24USB23KEY4.png\" src=\"../../media/24USB23KEY4.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Vitesse moyenne</span><a class=\"headerlink\" href=\"#id9\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Applicable uniquement \u00e0 RF Dongle avec les versions FWVerL et sup\u00e9rieures. Notez que la vitesse du scanner et du r\u00e9cepteur doit correspondre, sinon des erreurs peuvent survenir lors de la transmission de codes \u00e0 barres longs.</p>\n</aside>", "a[href=\"#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vitesse moyenne<a class=\"headerlink\" href=\"#medium-speed\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY9.png\"><img alt=\"../../media/24USB23KEY9.png\" src=\"../../media/24USB23KEY9.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Faible vitesse</span><a class=\"headerlink\" href=\"#id10\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/24RF23CH02.png\"><img alt=\"../../media/24RF23CH02.png\" src=\"../../media/24RF23CH02.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Appairage unique</span><a class=\"headerlink\" href=\"#id6\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#wireless-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode sans fil<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Lien vers cette rubrique\">#</a></h1><p>Ce mode utilise le 2. Bande de fr\u00e9quence GHz pour la transmission de donn\u00e9es et repose sur la technologie de fr\u00e9quence radio (RF) qui se connecte \u00e0 l\u2019ordinateur via un r\u00e9cepteur USB et permet au scanner de se d\u00e9placer librement \u00e0 une certaine distance.</p>", "a[href=\"#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Haute Vitesse<a class=\"headerlink\" href=\"#high-speed\" title=\"Lien vers cette rubrique\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
